"""## **5.1 Proportional Chance Criterion (PCC)**

The **Proportional Chance Criterion (PCC)** provides a measure of how imbalanced a dataset is by calculating the likelihood of correctly predicting the target class by chance. It is the sum of squared proportions of each class in the dataset. Lower PCC values indicate a more balanced dataset
"""

def calculate_pcc(y):

    class_proportions = y.value_counts(normalize=True)  # Calculate class proportions
    pcc = (class_proportions ** 2).sum()  # Sum of squared proportions
    return pcc

# Calculate PCC Before SMOTE
